      "This study needs an incognito/private window, and this window isn’t. You can fix this. Using any browser other than Safari, open an incognito window, and run the study link in that window. \n \n EXPLANATION: All major browsers allow you to open a window in incognito mode, though the name varies, e.g. “Incognito”, “InPrivate”, “Private Browsing”, or “Private Window”. All browsers except Safari report whether the web page is in incognito mode. Safari always says no. Incognito mode is typically used for privacy. EasyEyes uses it to ease access to the EasyEyes Firebase library, which is needed for sound calibration.",
