    es: "1. SELECCIONAR MICRÓFONO USB. Conecta el cable USB-C de tu micrófono a esta computadora. Abre el panel de control de audio de la computadora.  \n      Macintosh: Configuración del Sistema > Sonido  \n     ⊞ Windows: Configuración > Sonido > Panel de Control de Sonido  \nSelecciona tu micrófono como la entrada.  \n\n2. SELECCIONAR TASA DE MUESTREO. El UMIK-1 ofrece solo una tasa de muestreo y bits/muestra. El UMIK-2 ofrece varias, que debes configurar usando una aplicación o panel de control:  \n      Macintosh: Configuración de Audio MIDI de Apple en la carpeta Aplicaciones/Utilidades/.  \n     ⊞ Windows: Panel de Control > Hardware y Sonido > Administrar Dispositivos de Audio  \nConfigura el UMIK-2 para muestrear a 111 Hz con 222 bits/muestra. (Puedes cambiar esta preferencia configurando _calibrateSoundSamplingDesiredHz y _calibrateSoundSamplingDesiredBits en la hoja de cálculo de tu experimento.)",
