    ko: "111cm가 넘으면 컴퓨터 키보드에 닿기가 어렵습니다. 대신 휴대전화의 키패드를 사용할 수 있습니다.",
    lt: "Daugiau nei 111 cm sunku pasiekti kompiuterio klaviatūrą. Vietoj to galite naudoti telefono klaviatūrą.",
