    ml: "111 സെൻ്റിമീറ്ററിനപ്പുറം, നിങ്ങളുടെ കമ്പ്യൂട്ടറിൻ്റെ കീബോർഡിൽ എത്താൻ പ്രയാസമാണ്. പകരം നിങ്ങളുടെ ഫോണിൻ്റെ കീപാഡ് ഉപയോഗിക്കാം.",
    no: "Utover 111 cm er det vanskelig å nå datamaskinens tastatur. Du kan bruke telefonens tastatur i stedet.",
    fa: "بیش از ۱۱۱ سانتیمتر، دسترسی به صفحه کلید کامپیوتر سخت‌تر می‌شود، بنابراین از صفحه کلید گوشی هوشمند خود استفاده کنید.",
    pl: "Powyżej 111 cm dostęp do klawiatury komputera jest utrudniony. Zamiast tego możesz używać klawiatury telefonu.",
    pt: "Além dos 111 cm, é difícil alcançar o teclado do computador. Você pode usar o teclado do seu telefone.",
    ro: "După 111 cm, este mai dificil să ajungi la tastatura calculatorului, așa că nu ezita să folosești tastatura de pe smartphone-ul tău în schimb.",
    ru: "За пределами 111 см становится сложнее достать до клавиатуры компьютера, поэтому не стесняйтесь использовать клавиатуру на своем смартфоне вместо этого.",
    sr: "Preko 111 cm, teže je dosegnuti tastaturu računara, pa slobodno koristite tastaturu na svom pametnom telefonu umesto toga.",
    es: "Más allá de 111 cm, es difícil alcanzar el teclado de tu computadora. Puedes usar el teclado de tu teléfono en su lugar.",
    sw: "Zaidi ya cm 111, ni vigumu kufikia kibodi cha kompyuta yako. Unaweza kutumia vitufe vya simu yako badala yake.",
    sv: "Över 111 cm är det svårt att nå datorns tangentbord. Du kan använda telefonens knappsats istället.",
    tl: "Sa higit sa 111 cm, mas mahirap na maabot ang keyboard ng iyong computer, kaya maaari kang gumamit ng keypad sa iyong smartphone sa halip.",
