    "en-UK":
      "IS THE TEST PHONE CONNECTED TO THE INTERNET?  \n1. YES, Click OK below.  \n2. Otherwise. MOBILE SERVICE: If the phone’s mobile service connects to the internet, click OK.  \n3. Otherwise. WIFI: If mobile service is unavailable, connect to the internet via Wi-Fi and click OK.  \n4. Otherwise. HOTSPOT: If the test phone is not your personal phone, and your personal phone has internet, they can share the connection.  \n    * Wi-Fi Hotspot: If your personal phone is connected to the internet via mobile service, it can provide a Wi-Fi hotspot to the test phone. Once connected, click OK.  \n    * Bluetooth Tethering: If your personal phone is using Wi-Fi for internet access, it can share this connection via Bluetooth. Enable Bluetooth (on iPhone) or Bluetooth tethering (on Android) on both phones, pair them via Bluetooth, and click OK.  \n    * USB Tethering: If both phones are either iPhones or Androids, they can share the internet connection via a USB cable, if you have the right cable. Most phones use a USB-C connector, but the iPhone 14 and earlier use the Lightning connector. Connect the phones via the appropriate cable and click OK.  \n5. NO INTERNET: If none of these options are available, first click OK and then “Can’t connect”.",
    fi: "Loading...",
    fr: "LE TÉLÉPHONE DE TEST EST-IL CONNECTÉ À INTERNET ?\n1. OUI, cliquez sur OK ci-dessous.\n2. Sinon. SERVICE CELLULAIRE : Si le service cellulaire du téléphone se connecte à Internet, cliquez sur OK.\n3. Sinon. WIFI : Si le service cellulaire n'est pas disponible, connectez-vous à Internet via Wi-Fi et cliquez sur OK.\n4. Sinon. HOTSPOT : Si le téléphone de test n'est pas votre téléphone personnel et que votre téléphone personnel a Internet, ils peuvent partager la connexion.\n    * Hotspot Wi-Fi : Si votre téléphone personnel est connecté à Internet via le service cellulaire, il peut fournir un hotspot Wi-Fi au téléphone de test. Une fois connecté, cliquez sur OK.\n    * Partage Bluetooth : Si votre téléphone personnel utilise le Wi-Fi pour accéder à Internet, il peut partager cette connexion via Bluetooth. Activez le Bluetooth (sur iPhone) ou le partage Bluetooth (sur Android) sur les deux téléphones, associez-les via Bluetooth et cliquez sur OK.\n    * Partage USB : Si les deux téléphones sont soit des iPhones soit des Androids, ils peuvent partager la connexion Internet via un câble USB, si vous avez le bon câble. La plupart des téléphones utilisent un connecteur USB-C, mais l'iPhone 14 et les versions antérieures utilisent le connecteur Lightning. Connectez les téléphones via le câble approprié et cliquez sur OK.\n5. PAS D'INTERNET : Si aucune de ces options n'est disponible, cliquez d'abord sur OK puis sur « Impossible de se connecter ».",
    de: "Loading...",
    el: "Loading...",
    he: "Loading...",
    hi: "Loading...",
    hu: "Loading...",
    is: "Loading...",
    id: "Loading...",
    it: "IL TELEFONO DI TEST È CONNESSO A INTERNET?\n1. SÌ, clicca OK qui sotto.\n2. Altrimenti. SERVIZIO CELLULARE: Se il servizio cellulare del telefono si connette a internet, clicca OK.\n3. Altrimenti. WIFI: Se il servizio cellulare non è disponibile, connettiti a internet tramite Wi-Fi e clicca OK.\n4. Altrimenti. HOTSPOT: Se il telefono di test non è il tuo telefono personale e il tuo telefono personale ha internet, possono condividere la connessione.\n    * Hotspot Wi-Fi: Se il tuo telefono personale è connesso a internet tramite servizio cellulare, può fornire un hotspot Wi-Fi al telefono di test. Una volta connesso, clicca OK.\n    * Tethering Bluetooth: Se il tuo telefono personale utilizza il Wi-Fi per l'accesso a internet, può condividere questa connessione tramite Bluetooth. Abilita il Bluetooth (su iPhone) o il tethering Bluetooth (su Android) su entrambi i telefoni, accoppiali tramite Bluetooth e clicca OK.\n    * Tethering USB: Se entrambi i telefoni sono iPhone o Android, possono condividere la connessione internet tramite un cavo USB, se hai il cavo giusto. La maggior parte dei telefoni utilizza un connettore USB-C, ma l'iPhone 14 e precedenti utilizzano il connettore Lightning. Collega i telefoni tramite il cavo appropriato e clicca OK.\n5. NESSUNA CONNESSIONE INTERNET: Se nessuna di queste opzioni è disponibile, prima clicca OK e poi “Impossibile connettersi”.",
