      "MAX VOLUME. For accurate sound calibration, please maximise your computer's sound volume now, before calibration, and then don't touch the volume until the end of the experiment.  \nNO HEADPHONES. Remove and disconnect any headphones/earbuds.  \nUSE CAMERA TO GET QR LINK. When the QR code appears below, point your smartphone camera at it, and click the link that appears on your smartphone screen. Then follow the instructions on the smartphone screen.  \n——————————————————————————————————————————  \nQUIET PLEASE! NOW RECORDING. DO NOT TOUCH THE VOLUME CONTROL.  \n——————————————————————————————————————————  \nPROBLEM?  \n1. The main web page running EasyEyes on your laptop uses the webRTC protocol to talk to the QR-linked webpage on your smartphone. This protocol seeks out the best of several ways to connect. The best is when your phone and computer are both on the same WiFi network.  \n2. If your smartphone reports an error in the connection, try quitting and restarting the smartphone browser, or even restarting the smartphone.  \n3. It's rare, but, if the sound doesn't play, or, after it plays, no Proceed button appears, it means the calibration failed. You can try again by refreshing this browser page: tap address; tap go. That usually does the trick.",
    fi: "Loading...",
    fr: "VOLUME MAXIMAL. Pour un étalonnage sonore précis, veuillez maximiser le volume sonore de votre ordinateur maintenant, avant l'étalonnage, et ne touchez plus au volume jusqu'à la fin de l'expérience. PAS D'ÉCOUTEURS. Retirez et déconnectez tout casque/écouteurs. UTILISEZ L'APPAREIL PHOTO POUR OBTENIR LE LIEN QR. Lorsque le code QR apparaît ci-dessous, pointez l'appareil photo de votre smartphone vers lui et cliquez sur le lien qui apparaît sur l'écran de votre smartphone. Ensuite, suivez les instructions à l'écran du smartphone. —————————————————————————————————————————— SILENCE S'IL VOUS PLAÎT ! ENREGISTREMENT EN COURS. NE TOUCHEZ PAS AU CONTRÔLE DU VOLUME. —————————————————————————————————————————— PROBLÈME ? 1. La page web principale exécutant EasyEyes sur votre ordinateur portable utilise le protocole webRTC pour communiquer avec la page web liée au QR sur votre smartphone. Ce protocole recherche le meilleur des plusieurs moyens de connexion. Le meilleur est lorsque votre téléphone et votre ordinateur sont tous deux sur le même réseau WiFi. 2. Si votre smartphone signale une erreur de connexion, essayez de quitter et de redémarrer le navigateur du smartphone, ou même de redémarrer le smartphone. 3. C'est rare, mais si le son ne se joue pas, ou, après qu'il se joue, aucun bouton Continuer n'apparaît, cela signifie que l'étalonnage a échoué. Vous pouvez réessayer en actualisant cette page de navigateur : tapez l'adresse ; tapez aller. Cela fonctionne généralement.",
