    es: "VOLUMEN MÁXIMO. Para una calibración de sonido precisa, por favor maximice el volumen de sonido de su computadora ahora, antes de la calibración, y luego no toque el volumen hasta el final del experimento. SIN AURICULARES. Retire y desconecte cualquier auricular/audífono. USE LA CÁMARA PARA OBTENER EL ENLACE QR. Cuando aparezca el código QR a continuación, apunte la cámara de su teléfono inteligente hacia él y haga clic en el enlace que aparece en la pantalla de su teléfono inteligente. Luego siga las instrucciones en la pantalla del teléfono inteligente. —————————————————————————————————————————— ¡SILENCIO POR FAVOR! AHORA GRABANDO. NO TOQUE EL CONTROL DE VOLUMEN. —————————————————————————————————————————— ¿PROBLEMA? 1. La página web principal que ejecuta EasyEyes en su computadora portátil utiliza el protocolo webRTC para comunicarse con la página web enlazada por QR en su teléfono inteligente. Este protocolo busca la mejor de varias formas de conectar. La mejor es cuando su teléfono y computadora están en la misma red WiFi. 2. Si su teléfono inteligente informa un error en la conexión, intente cerrar y reiniciar el navegador del teléfono inteligente, o incluso reiniciar el teléfono inteligente. 3. Es raro, pero, si el sonido no se reproduce, o, después de reproducirse, no aparece el botón de Continuar, significa que la calibración falló. Puede intentarlo de nuevo actualizando esta página del navegador: toque la dirección; toque ir. Eso generalmente soluciona el problema.",
