    fi: "Loading...",
    fr: "EXPLICATION. Pour cette étape, rapprochez-vous si nécessaire, de sorte que vous ne soyez pas à plus de deux fois la largeur de l'écran. Chaque œil a un point aveugle. Nous allons trouver le vôtre pour découvrir à quelle distance votre œil est de l'écran. On vous demandera de fermer ou de couvrir un œil pour isoler l'autre. Pendant que vous vous concentrez sur la croix, regardez le point clignotant du coin de l'œil et appuyez sur RETOUR lorsqu'il disparaît dans votre point aveugle. Selon la distance de vision et la taille de l'écran, le point clignotant atteindra généralement votre point aveugle avant d'arriver au milieu de l'écran. Vous ferez cela avec chaque œil, en alternant, jusqu'à ce que les deux dernières mesures soient cohérentes. Veuillez maintenir votre distance de vision pendant que vous testez les deux yeux. REMARQUE. Si le point ne disparaît jamais, cela signifie que votre œil suit le point, au lieu de rester sur la croix. Ce test nécessite que vous gardiez votre œil sur la croix tout en surveillant le point clignotant dans le coin de votre œil. C'est difficile au début, mais cela devient plus facile avec la pratique.",
