    ar: "في كل تجربة، بينما تنظر إلى الصليب، ستومض ثلاثية من ثلاثة أحرف عشوائية في زاوية عينك. مجرد وميض. لتعلم المهمة، دعونا نحاولها أولاً بعرض ثابت. أثناء النظر إلى الصليب، أدناه، دون تحريك عينيك: ما هو الحرف الأوسط؟\n\n             +             ب ر ج\n\nإنه حرف ر. هذا العرض ثابت، لذا سيكون من السهل تحريك عينيك إلى الحرف وتحديده. ولكن، في تجربة حقيقية، يتم وميض الأحرف، لذا لا يوجد وقت لتحريك عينيك. يرجى النظر إلى الصليب عند بدء التجربة. لا يهم أين تذهب عينيك بعد الوميض. الكتلة الأولى من الاختبار هي مجرد بضع تجارب تدريبية، قبل أن نبدأ بجدية.",
